// src/components/SocialLinks.js
import React from 'react';

const SocialLinks = () => (
  <section id="social-links">
    <h2>Connect with me</h2>
    <div className="social-links">
      <a href="https://x.com/MDRyan43203488" target="_blank" rel="noopener noreferrer">Twitter</a>
      <a href="https://github.com/Monwabisindlovu" target="_blank" rel="noopener noreferrer">GitHub</a>
      <a href="https://www.linkedin.com/in/monwabisi-ndlovu-3270a020b" target="_blank" rel="noopener noreferrer">LinkedIn</a>
    </div>
  </section>
);

export default SocialLinks;
